import React, { useState, useEffect } from 'react';
import classNames from 'classnames';

const Navbar = () => {
  const [isSticky, setIsSticky] = useState(false);
  const [isOpen, setIsOpen] = useState(false);
  const [searchModalOpen, setSearchModalOpen] = useState(false);

  useEffect(() => {
    const handleScroll = () => {
      setIsSticky(window.scrollY > 0);
    };

    window.addEventListener('scroll', handleScroll);
    return () => {
      window.removeEventListener('scroll', handleScroll);
    };
  }, []);

  return (
    <div className={classNames({ 'shadow-2xl bg-white': isSticky })} style={{ height: '2000px' }}>
      <nav className={classNames('lg:flex hidden mx-auto max-w-7xl items-center bg-white py-2 rounded-md justify-between px-6', { 'mt-0 px-0': isSticky, 'mt-6 px-0 shadow': !isSticky })} aria-label="Global">
        <div className="flex lg:flex-1">
          <a href="https://pikapower.belva.co.ke/" className="-m-1.5 p-1.5">
            <span className="sr-only">Your Company</span>
            <img className="h-16 w-auto" src="./Kenya Power PLC_files/logo.svg" alt="Your Company" />
          </a>
        </div>
        <div className="flex lg:hidden">
          <button onClick={() => setIsOpen(!isOpen)} type="button" className="-m-6.5 inline-flex items-center justify-center rounded-md p-6.5 text-gray-400">
            <span className="sr-only">Open main menu</span>
            <svg className="h-6 w-6" fill="none" viewBox="0 0 24 24" strokeWidth="1.5" stroke="currentColor" aria-hidden="true">
              <path strokeLinecap="round" strokeLinejoin="round" d="M3.75 6.75h16.5M3.75 12h16.5m-16.5 5.25h16.5"></path>
            </svg>
          </button>
        </div>
        <div className="hidden lg:flex lg:gap-x-12">
          <a href="https://pikapower.belva.co.ke/about-us" className="text-base dark:text-black hover:underline hover:underline-offset-4 font-normal text-black">About</a>
          <a href="https://pikapower.belva.co.ke/classes" className="text-base dark:text-black hover:underline hover:underline-offset-4 font-normal text-black">Class</a>
          <a href="https://pikapower.belva.co.ke/articles-resources" className="text-base dark:text-black hover:underline hover:underline-offset-4 font-normal text-black">Articles & Resources</a>
          <a href="https://pikapower.belva.co.ke/events" className="text-base dark:text-black hover:underline hover:underline-offset-4 font-normal text-black">Events</a>
          <a href="https://pikapower.belva.co.ke/contact-us" className="text-base dark:text-black hover:underline hover:underline-offset-4 font-normal text-black">Contact Us</a>
        </div>
        <div className="hidden lg:flex lg:flex-1 lg:justify-end">
          <div className="flex items-center lg:ml-8">
            <div className="ml-4 flow-root lg:ml-8">
              <button onClick={() => setSearchModalOpen(true)} type="button" className="group -m-2 flex items-center p-2 bg-primary rounded-full">
                <span className="sr-only">Search</span>
                <svg className="h-6 w-6 text-yellow" fill="none" viewBox="0 0 24 24" strokeWidth="1.5" stroke="currentColor" aria-hidden="true">
                  <path strokeLinecap="round" strokeLinejoin="round" d="M21 21l-5.197-5.197m0 0A7.5 7.5 0 105.196 5.196a7.5 7.5 0 0010.607 10.607z"></path>
                </svg>
              </button>

              {searchModalOpen && (
                <div className="fixed inset-0 z-30 flex w-full items-start justify-center bg-black/20 p-4 pb-8 backdrop-blur-md lg:p-8" role="dialog" aria-modal="true" aria-labelledby="defaultModalTitle">
                  <div className="flex w-full max-w-2xl flex-col gap-4 overflow-hidden rounded-xl border border-slate-300 bg-slate-100 text-slate-700 dark:border-slate-700 dark:bg-slate-800 dark:text-slate-300">
                  </div>
                </div>
              )}
            </div>
          </div>
        </div>
      </nav>
    </div>
  );
};

export default Navbar;
